import '../style/Header.css'

const Header = () => {

    const handleSelect = (id) => {
        console.log(`key: ${id}`);
    }

    return (
        <nav>
            <label>
                    Temelio Fund Manager
            </label>
            <ul>
                <li class="selected" key="1" onclick={handleSelect}></li>
                <li key="2" onclick={handleSelect}>
                    <a href="#">Non-Profits</a>
                </li>
                <li key="3" onclick={handleSelect}>
                    <a href="#">Send Email</a>
                </li>
            </ul>
        </nav>
    );
}

export default Header;
